import { createStore } from 'redux'

function todos(state = {}, action) {
    switch (action.type) {
        case 'UPDATE_STATE':
            console.log(action.state)
            state.ToDoList = action.state.ToDoList
            state.ToDoObject = action.state.ToDoObject
            state.CurrentList = action.state.CurrentList
            return state
        case 'CHANGE_LIST':
            console.log("hi" + action.text.toString())
            state.CurrentList = action.text
            return state
        default:
            return state
    }
}
let store = createStore(todos, {
    ToDoObject:{
        "ONE": ["HIYA", "HELLLOOOO"],
        "TWO": ["BYEYA", "GOODBYEE"]
    },
    ToDoList:["ONE", "TWO"],
    CurrentList: "TWO"
})



export default store
